import Navbar from 'react-bootstrap/Navbar';
import {Nav, Offcanvas, Container} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import {useState} from 'react'

function NaviBar() {
  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const toggleShow = () => setShow((s) => !s);

    return (
        <Navbar bg="light" expand={false}>
        <Container fluid>
          <Navbar.Brand href="#">FX's Portfolio</Navbar.Brand>
          <Navbar.Toggle aria-controls="offcanvasNavbar" show={show} onHide={handleClose} />
          <Navbar.Offcanvas
            id="offcanvasNavbar"
            aria-labelledby="offcanvasNavbarLabel"
            placement='top'

          >
            <Offcanvas.Header closeButton>
              <Offcanvas.Title id="offcanvasNavbarLabel">FX's Portfolio</Offcanvas.Title>
            </Offcanvas.Header>
            <Offcanvas.Body>
              <Nav>
                <Link to="/projects" onClick={handleClose}>Home</Link>
                </Nav>
                <Nav>
                <Link to="/projects">Projects</Link>
                </Nav>
            </Offcanvas.Body>
          </Navbar.Offcanvas>
        </Container>
      </Navbar>
    );
  }

  export default NaviBar;
